/** Store bytes for the given index into {@code dest}, without the first k bytes. */
private void get(int i, int k, BytesRef dest) {
  BytesRef ref = get(i);
  assert ref.length >= k;
  dest.bytes = ref.bytes;
  dest.offset = ref.offset + k;
  dest.length = ref.length - k;
}

